ypically in clusters near conifers\n  or hardwoods throughout the northern hemisphere&lt;/p&gt;&lt;p&gt;The name fly agaric comes from its use as a control for pesky flies. The old practice was to soaking pieces of\n  the mushroom in a saucer of milk to attract flies. The flies would drink the tainted milk, become intoxicated, and\n  fly into walls to their death.&lt;/p&gt;&#39;,NULL,&#39;&#39;,NULL,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:38&#39;,&#39;2011-09-11 04:32:38&#39;,&#39;2011-09-08 04:32:38&#39;,&#39;2011-09-10 04:32:38&#39;,NULL,2.5,1,0),(272,&#39;a509ebdb2fc8083f3a33ea17985baf03&#39;,&#39;&#39;,NULL,3,NULL,3,&#39;&#39;,3,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&lt;p&gt;ÙØ§ÙÙØ¹Ø±ÙÙ Ø¨Ø§Ø³Ù ØºØ§Ø±ÙÙÙÙ ØªØ·ÙØ± Ø£Ù ØªØ·ÙØ± Ø§ÙØ£ÙØ§ÙÙØªØ Ø§ÙØ£ÙØ§ÙÙØª muscaria ÙÙ basidiomycete Ø§ÙÙÙÙÙØ±ÙØ²Ø§\n     Ø§ÙÙØ·Ø±ÙØ§Øª Ø§ÙØ³Ø§ÙØ© Ø§ÙØªÙ ØªØ­ØªÙÙ Ø¹ÙÙ Ø¹Ø¯Ø© ÙØ§ÙÙØ±ÙØ¨Ø§Øª Ø§ÙÙÙØ³Ø§ÙÙØ©. Ø§ÙØ£ÙØ§ÙÙØª muscaria ÙÙ ÙÙÙØ°Ø¬Ù \&quot;Ø§ÙÙØ·Ø±\&quot; Ø¹ÙØ´ Ø§ÙØºØ±Ø§Ø¨Ø\n     ÙØ¹ Ø§ÙØ®ÙØ§Ø´ÙÙ Ø§ÙØ¨ÙØ¶Ø§Ø¡ ÙØ§ÙØ¨Ø«ÙØ± Ø§ÙØ¨ÙØ¶Ø§Ø¡ Ø¹ÙÙ ØºØ·Ø§Ø¦ÙØ§ Ø§ÙÙÙÙÙØ© Ø¨ÙØ³Ø¨ ÙØ®ØªÙÙØ© ÙÙØªØ²Ø§ÙØ¯Ø© Ø¹Ø§Ø¯Ø© ÙÙ ÙØ¬ÙÙØ¹Ø§Øª ÙØ±Ø¨ Ø§ÙØµÙÙØ¨Ø±ÙØ§Øª\n   Ø£Ù Ø§ÙØ£Ø®Ø´Ø§Ø¨ ÙÙ Ø¬ÙÙØ¹ Ø£ÙØ­Ø§Ø¡ ÙØµÙ Ø§ÙÙØ±Ø© Ø§ÙØ´ÙØ§ÙÙ &lt;/ P&gt; ÙØªØ·ÙØ± ØºØ§Ø±ÙÙÙÙ Ø§Ø³Ù ÙØ£ØªÙ ÙÙ Ø§Ø³ØªØ®Ø¯Ø§ÙÙ ÙØ¹ÙØµØ± ØªØ­ÙÙ Ø¹Ù Ø§ÙØ°Ø¨Ø§Ø¨ Ø§ÙÙØ²Ø¹Ø¬. ÙØ§ÙØª Ø§ÙÙÙØ§Ø±Ø³Ø© Ø§ÙÙØ¯ÙÙØ© ÙÙØ·Ø¹ ÙÙ ØªÙØ±Øº\n   Ø§ÙÙØ·Ø± ÙÙ Ø§ÙØµØ­Ù ÙÙ Ø§ÙØ­ÙÙØ¨ ÙØ§Ø¬ØªØ°Ø§Ø¨ Ø§ÙØ°Ø¨Ø§Ø¨. ÙØ¥Ù Ø§ÙØ°Ø¨Ø§Ø¨ Ø´Ø±Ø¨ Ø§ÙØ­ÙÙØ¨ Ø§ÙÙÙÙØ«Ø ÙØªØµØ¨Ø­ Ø­Ø§ÙØ© Ø³ÙØ±Ø Ù\n   ØªØ·ÙØ± ÙÙ Ø§ÙØ¬Ø¯Ø±Ø§Ù ÙÙÙØªÙÙ. &lt;/ P&gt;&#39;,NULL,&#39;&#39;,NULL,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:39&#39;,&#39;2011-09-11 04:32:39&#39;,&#39;2011-09-08 04:32:39&#39;,&#39;2011-09-10 04:32:39&#39;,NULL,2.5,1,0),(273,&#39;3a117abf96e7fe8793ef87b14d166e1l&#39;,&#39;&#39;,NULL,3,NULL,3,&#39;&#39;,2,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&lt;p&gt; CommunÃ©ment appelÃ© la volÃ©e ou amanite tue-mouche Amanita, Amanita muscaria est un basidiomycÃ¨te mycorhiziens\n     champignon qui contient plusieurs toxiques, de composÃ©s psychoactifs. Amanita muscaria est le typique \&quot;champignon\&quot; champignon,\n     portant des branchies blanches et les verrues blanches sur son capuchon de couleur variable et croissante gÃ©nÃ©ralement en grappes Ã  proximitÃ© de conifÃ¨res\n   ou de feuillus dans l\&#39;hÃ©misphÃ¨re nord &lt;/ p&gt; L\&#39;amanite tue-mouche nom vient de son utilisation comme un contrÃ´le des mouches des embÃªtants. L\&#39;ancienne pratique Ã©tait de trempage des piÃ¨ces\n   le champignon dans une soucoupe de lait pour attirer les mouches. Les mouches ne boire le lait contaminÃ©, s\&#39;enivrer, et\n   voler dans les murs de leur mort. &lt;/ p&gt;&#39;,NULL,&#39;&#39;,NULL,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:39&#39;,&#39;2011-09-11 04:32:39&#39;,&#39;2011-09-08 04:32:39&#39;,&#39;2011-09-10 04:32:39&#39;,NULL,2.5,1,0),(274,&#39;a509ebdb2fc8083f3a33ea17985baf04&#39;,&#39;&#39;,NULL,3,NULL,3,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Recent cases highlight the issue of the similarity of A. phalloides to the \n    edible paddy straw mushroom, Volvariella volvacea, with east- and southeast-Asian immigrants in Australia \n    and the west coast of the United States falling victim. In an episode in Oregon, four members of a Korean \n    family required liver transplants (Benjamin 1995). Of the seven people poisoned in the Canberra region between \n    1988 and 1998, three were from Laos (Trimm et al. 1999). This misidentification is a leading cause of mushroom\n     poisoning in the United States.&#39;,NULL,&#39;&#39;,NULL,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:39&#39;,&#39;2011-09-11 04:32:39&#39;,&#39;2011-09-08 04:32:39&#39;,&#39;2011-09-10 04:32:39&#39;,NULL,2.5,1,0),(275,&#39;3a117abf96e7fe8793ef87b14d166e1m&#39;,&#39;&#39;,NULL,3,NULL,3,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Learn how three fiery, painful stings during an early morning swim in Hawaii changed the \n    life of researcher Angel Yanagihara. Once the young biochemist had recovered from her box jelly encounter, \n    Carybdea alata had her full attention. Now she works to unlock the secrets of venom of these beautiful, \n    and sometimes dangerous, angels of the sea. Listen to the box jellyfish podcast on the EOL Learning + \n    Education website, where you can also meet featured scientist Angel Yanagihara, view amazing jellyfish images, \n    and find relevant educational activities.&#39;,NULL,&#39;&#39;,NULL,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:40&#39;,&#39;2011-09-11 04:32:40&#39;,&#39;2011-09-08 04:32:40&#39;,&#39;2011-09-10 04:32:40&#39;,NULL,2.5,1,0),(276,&#39;3a117abf96e7fe8793ef87b14d166e1n&#39;,&#39;&#39;,NULL,1,NULL,1,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Dolor natus et est ut consequatur.&#39;,NULL,&#39;&#39;,201012041086784,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:43&#39;,&#39;2011-09-11 04:32:43&#39;,&#39;2011-09-08 04:32:43&#39;,&#39;2011-09-10 04:32:43&#39;,NULL,2.5,1,0),(277,&#39;a509ebdb2fc8083f3a33ea17985baf06&#39;,&#39;&#39;,NULL,1,NULL,1,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Labore temporibus animi est.&#39;,NULL,&#39;&#39;,201009280303944,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:43&#39;,&#39;2011-09-11 04:32:43&#39;,&#39;2011-09-08 04:32:43&#39;,&#39;2011-09-10 04:32:43&#39;,NULL,2.5,1,0),(278,&#39;3a117abf96e7fe8793ef87b14d166e1o&#39;,&#39;&#39;,NULL,2,NULL,2,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Eveniet exercitationem omnis dolorem commodi rem.&#39;,NULL,&#39;&#39;,201105040535175,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:44&#39;,&#39;2011-09-11 04:32:44&#39;,&#39;2011-09-08 04:32:44&#39;,&#39;2011-09-10 04:32:44&#39;,NULL,2.5,1,0),(279,&#39;a509ebdb2fc8083f3a33ea17985baf07&#39;,&#39;&#39;,NULL,3,NULL,3,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Dinochelus ausubeli is a new species of deepwater lobster (family Nephropidae) first collected in\n    2007 from the Philippine Sea off the island of Luzon and was formally described in 2010. The species is so\n  distinct that it was not only described as a new species but placed in a newly erected genus as well (Dinochelus).\n    \&quot;Dinochelus\&quot; is derived from the Greek dinos, meaning \&quot;terrible\&quot;, and chela, meaning \&quot;claw\&quot;, an allusion to the\n  massive, spinose major claw. The specific epithet ausubeli honors Jesse Ausubel, an enthusiastic sponsor of the\n  Census of Marine Life, a major effort to document marine life in the first decade of the 21st century. (Ahyong et al. 2010)&#39;,NULL,&#39;&#39;,NULL,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:44&#39;,&#39;2011-09-11 04:32:44&#39;,&#39;2011-09-08 04:32:44&#39;,&#39;2011-09-10 04:32:44&#39;,NULL,2.5,1,0),(280,&#39;a509ebdb2fc8083f3a33ea17985baf08&#39;,&#39;&#39;,NULL,1,NULL,1,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Eligendi quasi et dolor repellendus ea officia non veritatis.&#39;,NULL,&#39;&#39;,200812102137415,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:46&#39;,&#39;2011-09-11 04:32:46&#39;,&#39;2011-09-08 04:32:46&#39;,&#39;2011-09-10 04:32:46&#39;,NULL,2.5,1,0),(281,&#39;3a117abf96e7fe8793ef87b14d166e1q&#39;,&#39;&#39;,NULL,1,NULL,1,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Ea quia nemo occaecati odio aut.&#39;,NULL,&#39;&#39;,200812102183535,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:47&#39;,&#39;2011-09-11 04:32:47&#39;,&#39;2011-09-08 04:32:47&#39;,&#39;2011-09-10 04:32:47&#39;,NULL,2.5,1,0),(282,&#39;a509ebdb2fc8083f3a33ea17985baf09