;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:52&#39;,&#39;2011-09-11 04:32:52&#39;,&#39;2011-09-08 04:32:52&#39;,&#39;2011-09-10 04:32:52&#39;,NULL,2.5,1,0),(290,&#39;a509ebdb2fc8083f3a33ea17985baf14&#39;,&#39;&#39;,NULL,1,NULL,1,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Beatae minima dolor ratione.&#39;,NULL,&#39;&#39;,201105312325504,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:54&#39;,&#39;2011-09-11 04:32:54&#39;,&#39;2011-09-08 04:32:54&#39;,&#39;2011-09-10 04:32:54&#39;,NULL,2.5,1,0),(291,&#39;3a117abf96e7fe8793ef87b14d166e1w&#39;,&#39;&#39;,NULL,1,NULL,1,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Tenetur id quo dolorum id molestias.&#39;,NULL,&#39;&#39;,201102040505636,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:55&#39;,&#39;2011-09-11 04:32:55&#39;,&#39;2011-09-08 04:32:55&#39;,&#39;2011-09-10 04:32:55&#39;,NULL,2.5,1,0),(292,&#39;a509ebdb2fc8083f3a33ea17985baf15&#39;,&#39;&#39;,NULL,1,NULL,1,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Et fuga eaque qui sunt.&#39;,NULL,&#39;&#39;,201102040570574,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:55&#39;,&#39;2011-09-11 04:32:55&#39;,&#39;2011-09-08 04:32:55&#39;,&#39;2011-09-10 04:32:55&#39;,NULL,2.5,1,0),(293,&#39;3a117abf96e7fe8793ef87b14d166e1x&#39;,&#39;&#39;,NULL,1,NULL,1,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Illo ratione et et deserunt enim nostrum.&#39;,NULL,&#39;&#39;,201105132311043,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:55&#39;,&#39;2011-09-11 04:32:55&#39;,&#39;2011-09-08 04:32:55&#39;,&#39;2011-09-10 04:32:55&#39;,NULL,2.5,1,0),(294,&#39;a509ebdb2fc8083f3a33ea17985baf16&#39;,&#39;&#39;,NULL,2,NULL,2,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Hic dolorem quis eum deserunt voluptas facilis sunt culpa.&#39;,NULL,&#39;&#39;,201105040555104,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:56&#39;,&#39;2011-09-11 04:32:56&#39;,&#39;2011-09-08 04:32:56&#39;,&#39;2011-09-10 04:32:56&#39;,NULL,2.5,1,0),(295,&#39;3a117abf96e7fe8793ef87b14d166e1y&#39;,&#39;&#39;,NULL,3,NULL,3,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&lt;p&gt;Pinus strobus, the Eastern White Pine, is characterized by fascicles of 5 fine needles with a\n    nonpersistent bundle sheath, and relatively soft, unarmed, elongate seed cones whose scales are spread at\n  maturity. The native range of eastern white pine stretches from southeastern Manitoba to Newfoundland in Canada and\n  from Minnesota and Iowa eastward to Maine and Pennsylvania, with a southward Appalachian extension to Tennessee and\n  Georgia and isolated occurrences in western Kentucky, Illinois, and Indiana. The species also has become\n  naturalized from plantings, both within its historical range and elsewhere, including portions of Europe, Asia, New\n  Zealand, and Australia. A related taxon in portions of southern Mexico and Guatemala is sometimes treated as Pinus\n  strobus var. chiapensis, but more often as a distinct species, Pinus chiapensis.\n&lt;/p&gt;&lt;p&gt;\n  Natural stands of Pinus strobus occur in a variety of habitats, ranging from dune forests to bogs and mixed\n  conifer/hardwood forests. The species also colonizes old fields and other former agricultural lands that are\n  reverting back to forests. It has been planted extensively in plantations and is also used to revegetate mine\n  spoils. The species also is cultivated commonly as a shade and ornamental tree\n&lt;/p&gt;&lt;p&gt;\n  Eastern White Pine is an important timber tree for the production of softwood lumber. The wood is used for\n  construction, cabinetry and furniture-making, handcrafts, and various other woodworking. Native American tribes\n  used it extensively for various medicinal properties and it is an important food source for wildlife. The long\n  history of cultivation has led to the development of numerous cultivars and forms. The species is affected by the\n  exotic white pine blister rust Cronartium ribicola, an important pathogen of timber trees in the white pine group\n  in temperate North America.&lt;/p&gt;&#39;,NULL,&#39;&#39;,NULL,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:57&#39;,&#39;2011-09-11 04:32:57&#39;,&#39;2011-09-08 04:32:57&#39;,&#39;2011-09-10 04:32:57&#39;,NULL,2.5,1,0),(296,&#39;3a117abf96e7fe8793ef87b14d166e1z&#39;,&#39;&#39;,NULL,1,NULL,1,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Hic omnis enim fuga aliquid accusamus.&#39;,NULL,&#39;&#39;,200901131343523,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:59&#39;,&#39;2011-09-11 04:32:59&#39;,&#39;2011-09-08 04:32:59&#39;,&#39;2011-09-10 04:32:59&#39;,NULL,2.5,1,0),(297,&#39;a509ebdb2fc8083f3a33ea17985baf18&#39;,&#39;&#39;,NULL,1,NULL,1,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Fugit enim repellendus atque.&#39;,NULL,&#39;&#39;,200901131383455,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:32:59&#39;,&#39;2011-09-11 04:32:59&#39;,&#39;2011-09-08 04:32:59&#39;,&#39;2011-09-10 04:32:59&#39;,NULL,2.5,1,0),(298,&#39;3a117abf96e7fe8793ef87b14d166e2a&#39;,&#39;&#39;,NULL,1,NULL,1,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Omnis facilis quae quibusdam.&#39;,NULL,&#39;&#39;,200901131367550,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:33:00&#39;,&#39;2011-09-11 04:33:00&#39;,&#39;2011-09-08 04:33:00&#39;,&#39;2011-09-10 04:33:00&#39;,NULL,2.5,1,0),(299,&#39;a509ebdb2fc8083f3a33ea17985baf19&#39;,&#39;&#39;,NULL,1,NULL,1,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Laudantium ducimus adipisci magni.&#39;,NULL,&#39;&#39;,201012100375791,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:33:00&#39;,&#39;2011-09-11 04:33:00&#39;,&#39;2011-09-08 04:33:00&#39;,&#39;2011-09-10 04:33:00&#39;,NULL,2.5,1,0),(300,&#39;3a117abf96e7fe8793ef87b14d166e2b&#39;,&#39;&#39;,NULL,2,NULL,2,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Enim corrupti quia voluptas distinctio.&#39;,NULL,&#39;&#39;,201105040573195,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:33:01&#39;,&#39;2011-09-11 04:33:01&#39;,&#39;2011-09-08 04:33:01&#39;,&#39;2011-09-10 04:33:01&#39;,NULL,2.5,1,0),(301,&#39;a509ebdb2fc8083f3a33ea17985baf20&#39;,&#39;&#39;,NULL,3,NULL,3,&#39;&#39;,1,NULL,1,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;&#39;,&#39;Anochetus are presumably predators, using their snapping mandibles much like their larger relatives,\n    Odontomachus. However, there are few direct observations. \&quot;A. mayri is found mostly in forests under stones, in\n    moss on rocks or logs, in rotten twigs on the forest floor, or in larger bodies of rotten wood. The workers and\n    queen feign death, and are difficult to see (Brown 1978).\&quot; There appear to be two distinct forms in the Atlantic\n    lowlands of Costa Rica, one of which may be more arboreal (see below).&#39;,NULL,&#39;&#39;,NULL,&#39;&#39;,NULL,&#39;&#39;,0,0,0,&#39;2011-09-08 04:33:01&#39;,&#39;2011-09-11 04:33:01&#39;,&#39;2011-09-08 04:33:01&#39;,&#39;2011-09-10 04:33:01&#39;,NULL,2.5,1,0);</td>
