        <td id="L1710" class="blob-num js-line-number" data-line-number="1710"></td>
        <td id="LC1710" class="blob-code js-file-line">CREATE TABLE `hierarchy_entries` (</td>
      </tr>
      <tr>
        <td id="L1711" class="blob-num js-line-number" data-line-number="1711"></td>
        <td id="LC1711" class="blob-code js-file-line">  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,</td>
      </tr>
      <tr>
        <td id="L1712" class="blob-num js-line-number" data-line-number="1712"></td>
        <td id="LC1712" class="blob-code js-file-line">  `guid` varchar(32) CHARACTER SET ascii NOT NULL,</td>
      </tr>
      <tr>
        <td id="L1713" class="blob-num js-line-number" data-line-number="1713"></td>
        <td id="LC1713" class="blob-code js-file-line">  `identifier` varchar(255) NOT NULL COMMENT &#39;recommended; a unique id from the provider for this node&#39;,</td>
      </tr>
      <tr>
        <td id="L1714" class="blob-num js-line-number" data-line-number="1714"></td>
        <td id="LC1714" class="blob-code js-file-line">  `source_url` text,</td>
      </tr>
      <tr>
        <td id="L1715" class="blob-num js-line-number" data-line-number="1715"></td>
        <td id="LC1715" class="blob-code js-file-line">  `name_id` int(10) unsigned NOT NULL COMMENT &#39;recommended; the name string for this node. It is possible that nodes have no names, but most of the time they will&#39;,</td>
      </tr>
      <tr>
        <td id="L1716" class="blob-num js-line-number" data-line-number="1716"></td>
        <td id="LC1716" class="blob-code js-file-line">  `parent_id` int(10) unsigned NOT NULL COMMENT &#39;recommended; the parent_id references the hierarchy_entry_id of the parent of this node. Used to create trees. Root nodes will have a partent_id of 0&#39;,</td>
      </tr>
      <tr>
        <td id="L1717" class="blob-num js-line-number" data-line-number="1717"></td>
        <td id="LC1717" class="blob-code js-file-line">  `hierarchy_id` smallint(5) unsigned NOT NULL COMMENT &#39;required; the id of the container hierarchy&#39;,</td>
      </tr>
      <tr>
        <td id="L1718" class="blob-num js-line-number" data-line-number="1718"></td>
        <td id="LC1718" class="blob-code js-file-line">  `rank_id` smallint(5) unsigned NOT NULL COMMENT &#39;recommended; when available, this is the id of the rank string which defines the taxonomic rank of the node&#39;,</td>
      </tr>
      <tr>
        <td id="L1719" class="blob-num js-line-number" data-line-number="1719"></td>
        <td id="LC1719" class="blob-code js-file-line">  `ancestry` varchar(500) CHARACTER SET ascii NOT NULL COMMENT &#39;not required; perhaps now obsolete. Used to store the materialized path of this node&#39;&#39;s ancestors&#39;,</td>
      </tr>
      <tr>
        <td id="L1720" class="blob-num js-line-number" data-line-number="1720"></td>
        <td id="LC1720" class="blob-code js-file-line">  `lft` int(10) unsigned NOT NULL COMMENT &#39;required; the left value of this node within the hierarchy&#39;&#39;s nested set&#39;,</td>
      </tr>
      <tr>
        <td id="L1721" class="blob-num js-line-number" data-line-number="1721"></td>
        <td id="LC1721" class="blob-code js-file-line">  `rgt` int(10) unsigned NOT NULL COMMENT &#39;required; the right value of this node within the hierarchy&#39;&#39;s nested set&#39;,</td>
      </tr>
      <tr>
        <td id="L1722" class="blob-num js-line-number" data-line-number="1722"></td>
        <td id="LC1722" class="blob-code js-file-line">  `depth` tinyint(3) unsigned NOT NULL COMMENT &#39;recommended; the depth of this node in within the hierarchy&#39;&#39;s tree&#39;,</td>
      </tr>
      <tr>
        <td id="L1723" class="blob-num js-line-number" data-line-number="1723"></td>
        <td id="LC1723" class="blob-code js-file-line">  `taxon_concept_id` int(10) unsigned NOT NULL COMMENT &#39;required; the id of the taxon_concept described by this hierarchy_entry&#39;,</td>
      </tr>
      <tr>
        <td id="L1724" class="blob-num js-line-number" data-line-number="1724"></td>
        <td id="LC1724" class="blob-code js-file-line">  `vetted_id` tinyint(3) unsigned NOT NULL DEFAULT &#39;0&#39;,</td>
      </tr>
      <tr>
        <td id="L1725" class="blob-num js-line-number" data-line-number="1725"></td>
        <td id="LC1725" class="blob-code js-file-line">  `published` tinyint(3) unsigned NOT NULL DEFAULT &#39;0&#39;,</td>
      </tr>
      <tr>
        <td id="L1726" class="blob-num js-line-number" data-line-number="1726"></td>
        <td id="LC1726" class="blob-code js-file-line">  `visibility_id` tinyint(3) unsigned NOT NULL DEFAULT &#39;0&#39;,</td>
      </tr>
      <tr>
        <td id="L1727" class="blob-num js-line-number" data-line-number="1727"></td>
        <td id="LC1727" class="blob-code js-file-line">  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,</td>
      </tr>
      <tr>
        <td id="L1728" class="blob-num js-line-number" data-line-number="1728"></td>
        <td id="LC1728" class="blob-code js-file-line">  `updated_at` timestamp NOT NULL DEFAULT &#39;0000-00-00 00:00:00&#39;,</td>
      </tr>
      <tr>
        <td id="L1729" class="blob-num js-line-number" data-line-number="1729"></td>
        <td id="LC1729" class="blob-code js-file-line">  PRIMARY KEY (`id`),</td>
      </tr>
      <tr>
        <td id="L1730" class="blob-num js-line-number" data-line-number="1730"></td>
        <td id="LC1730" class="blob-code js-file-line">  KEY `name_id` (`name_id`),</td>
      </tr>
      <tr>
        <td id="L1731" class="blob-num js-line-number" data-line-number="1731"></td>
        <td id="LC1731" class="blob-code js-file-line">  KEY `parent_id` (`parent_id`),</td>
      </tr>
      <tr>
        <td id="L1732" class="blob-num js-line-number" data-line-number="1732"></td>
        <td id="LC1732" class="blob-code js-file-line">  KEY `lft` (`lft`),</td>
      </tr>
      <tr>
        <td id="L1733" class="blob-num js-line-number" data-line-number="1733"></td>
        <td id="LC1733" class="blob-code js-file-line">  KEY `taxon_concept_id` (`taxon_concept_id`),</td>
      </tr>
      <tr>
        <td id="L1734" class="blob-num js-line-number" data-line-number="1734"></td>
        <td id="LC1734" class="blob-code js-file-line">  KEY `vetted_id` (`vetted_id`),</td>
      </tr>
      <tr>
        <td id="L1735" class="blob-num js-line-number" data-line-number="1735"></td>
        <td id="LC1735" class="blob-code js-file-line">  KEY `visibility_id` (`visibility_id`),</td>
      </tr>
      <tr>
        <td id="L1736" class="blob-num js-line-number" data-line-number="1736"></td>
        <td id="LC1736" class="blob-code js-file-line">  KEY `published` (`published`),</td>
      </tr>
      <tr>
        <td id="L1737" class="blob-num js-line-number" data-line-number="1737"></td>
        <td id="LC1737" class="blob-code js-file-line">  KEY `identifier` (`identifier`),</td>
      </tr>
      <tr>
        <td id="L1738" class="blob-num js-line-number" data-line-number="1738"></td>
        <td id="LC1738" class="blob-code js-file-line">  KEY `hierarchy_parent` (`hierarchy_id`,`parent_id`),</td>
      </tr>
      <tr>
