        <td id="LC2069" class="blob-code js-file-line">  `string` varchar(300) NOT NULL COMMENT &#39;the actual name. This is unique - every unique sequence of characters has one and only one name_id (we should probably add a unique index to this field)&#39;,</td>
      </tr>
      <tr>
        <td id="L2070" class="blob-num js-line-number" data-line-number="2070"></td>
        <td id="LC2070" class="blob-code js-file-line">  `clean_name` varchar(300) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT &#39;there is a one to one reltaionship between a name string and a clean name. The clean name takes the string and lowercases it (uncluding diacriticals), removes leading/trailing whitespace, removes some punctuation (periods and more), and pads remaining pun&#39;,</td>
      </tr>
      <tr>
        <td id="L2071" class="blob-num js-line-number" data-line-number="2071"></td>
        <td id="LC2071" class="blob-code js-file-line">  `italicized` varchar(300) NOT NULL COMMENT &#39;required; this includes html &lt;i&gt; tags in the proper place to display the string in its italicized form. Generally only species and subspecific names are italizied. Usually algorithmically generated&#39;,</td>
      </tr>
      <tr>
        <td id="L2072" class="blob-num js-line-number" data-line-number="2072"></td>
        <td id="LC2072" class="blob-code js-file-line">  `italicized_verified` tinyint(3) unsigned NOT NULL COMMENT &#39;required; if an editor verifies the italicized form is correct, or corrects it, this should be set to 1 so it is not algorithmically replaced if we change the algorithm&#39;,</td>
      </tr>
      <tr>
        <td id="L2073" class="blob-num js-line-number" data-line-number="2073"></td>
        <td id="LC2073" class="blob-code js-file-line">  `canonical_form_id` int(10) unsigned NOT NULL COMMENT &#39;required; every name string has a canonical form&#39;,</td>
      </tr>
      <tr>
        <td id="L2074" class="blob-num js-line-number" data-line-number="2074"></td>
        <td id="LC2074" class="blob-code js-file-line">  `ranked_canonical_form_id` int(10) unsigned DEFAULT NULL,</td>
      </tr>
      <tr>
        <td id="L2075" class="blob-num js-line-number" data-line-number="2075"></td>
        <td id="LC2075" class="blob-code js-file-line">  `canonical_verified` tinyint(3) unsigned NOT NULL COMMENT &#39;required; same as with italicized form, if an editor verifies the canonical form we want to maintin their edits if we were to redo the canonical form algorithm&#39;,</td>
      </tr>
      <tr>
        <td id="L2076" class="blob-num js-line-number" data-line-number="2076"></td>
        <td id="LC2076" class="blob-code js-file-line">  PRIMARY KEY (`id`),</td>
      </tr>
      <tr>
        <td id="L2077" class="blob-num js-line-number" data-line-number="2077"></td>
        <td id="LC2077" class="blob-code js-file-line">  KEY `canonical_form_id` (`canonical_form_id`),</td>
      </tr>
      <tr>
        <td id="L2078" class="blob-num js-line-number" data-line-number="2078"></td>
        <td id="LC2078" class="blob-code js-file-line">  KEY `clean_name` (`clean_name`(255))</td>
      </tr>
      <tr>
        <td id="L2079" class="blob-num js-line-number" data-line-number="2079"></td>
        <td id="LC2079" class="blob-code js-file-line">) ENGINE=InnoDB AUTO_INCREMENT=103 DEFAULT CHARSET=utf8 COMMENT=&#39;Represents the name of a taxon&#39;;</td>
      </tr>
